import React from "react";

interface Props {
  heading: string;
}

const PageHeading: React.FC<Props> = ({ heading }) => {
  return (
    <div className="page-heading-container">
      <h1 className="page-heading">{heading}</h1>
    </div>
  );
};

export default PageHeading;
